  true,\n\t\"url\": null,\n\t\"notes\": \"The Global Precipitation Climatology Project
  (GPCP) Version 2 data set includes global, monthly precipitation rates and associated
  random errors (RMSE), and a monthly precipitation climatology derived as an average
  from all GPCP data sets from January 1979 to December 1999. The data are derived
  from measured gauge data and merged with satellite estimates of rainfall. This is
  a portion of the version 2 GPCP data and covers the ISLSCP II period from 1986 to
  1995. There are six data files included with this data set:  the original precipitation
  rates, errors and climatology at 2.5 degrees spatial resolution, and the same data
  \ re-gridded to a 1 degree spatial resolution by the ISLSCP II staff.and merged
  with satellite estimates of rainfall. This is a portion of the version 2 GPCP data
  sets and covers the ISLSCP II period from 1986 to 1995. There are six data files
  included with this data set:  the original precipitation rates, errors and climatology
  at 2.5 degrees spatial resolution, and the same data  re-gridded to a 1 degree spatial
  resolution by the ISLSCP II staff.\",\n\t\"license_title\": \"U.S. Government Work\",\n\t\"extras\":
